import React from "react";

const mainnav = {
  display: " flex",
  listStyleType: "none",
  gap: "15px",
};

const divstyle = {
  width: "100vw",
  display: "flex",
  justifyContent: "center",
};

const Navbar = (props) => {
  return (
    <div className="main-nav " style={divstyle}>
      <ul style={mainnav}>
        <li>{props.first}</li>
        <li>{props.second}</li>
        <li>{props.third}</li>
        <li>{props.fourth}</li>
      </ul>
    </div>
  );
};

export default Navbar;
